import {
  Button,
  Popover,
  PopoverBody,
  PopoverHeader,
  UncontrolledPopover,
  CloseButton,
} from "reactstrap";
import useState from "react";
import Cart from "./cart";

export default function PopOver() {
  [close, setClose] = useState(true);
  return (
    <div>
      <Button
        className=' mt-2'
        color='primary'
        id='popover644119284'
        type='button'
        onClick={(e) => setClose(false)}>
        Popover on top
      </Button>
      <UncontrolledPopover
        placement='top'
        target='popover644119284'>
        <PopoverBody>
          <CloseButton />
          <Cart />
        </PopoverBody>
      </UncontrolledPopover>
    </div>
  );
}
